description:
This is my first Torrent.  I have uploaded Star ocean the first departure. It is a remake of the original star ocean that release on the SNES only in Japan.  Included is YACC (Yet another iso compressor) witch will allow you to compress the game in a format that the psp will still read.  I also included the full version of winrar for extracting the files.

You will need to be running Custom firmware to run the game.  I have tested it on dark alex's 4.01 m33-2.  to learn more about hacking the psp see &lt;a href=&quot;
